import{_ as t,c as a,o as s,a as r}from"./app.7586e3b1.js";const p="/st0028-01.jpg",e="/st0028-02.png",l="/st0028-03.png",o="/st0028-04.png",n="/st0028-05.png",_="/st0028-06.png",C=JSON.parse('{"title":"凹语言和你相约 2023 世界人工智能大会","description":"","frontmatter":{},"headers":[],"relativePath":"smalltalk/st0028.md"}'),c={name:"smalltalk/st0028.md"},i=r('<h1 id="凹语言和你相约-2023-世界人工智能大会" tabindex="-1">凹语言和你相约 2023 世界人工智能大会 <a class="header-anchor" href="#凹语言和你相约-2023-世界人工智能大会" aria-hidden="true">#</a></h1><ul><li>时间：2023-07-05</li><li>撰稿：凹语言 开发组</li><li>转载请注明原文链接：<a href="https://wa-lang.org/smalltalk/st0028.html" target="_blank" rel="noreferrer">https://wa-lang.org/smalltalk/st0028.html</a></li></ul><hr><p><img src="'+p+'" alt=""></p><p>2023世界人工智能大会（WAIC）将于7月6-8日在上海举办，并在浦东张江、徐汇西岸设分会场。由 OpenTEKr 和 Datawhale 社区联合发起并主办的“开源集市”将在 WAIC 世博主会场携手 36+ 家优质开源社区和组织设立开源展示专区，以让广大开发者、非技术从业者伙伴们领略多彩的开源文化与项目价值。</p><p>官网地址：<a href="https://www.worldaic.com.cn/" target="_blank" rel="noreferrer">https://www.worldaic.com.cn/</a></p><p><img src="'+e+'" alt=""></p><p>凹语言作为国内首个实现浏览器内编译、执行全链路的国产编程语言开源项目，将首次正式在WAIC的开源集市板块参展。</p><p><img src="'+l+'" alt=""></p><p>同时凹语言的联合发起人将在世博会主会场的开源社区开放麦分享《凹语言GLCC课题中的创新体会》，探讨躺平式持续创新的模式。</p><p><img src="'+o+'" alt=""></p><p>作为纯草根类的基础开源软件社区，社区的运作也全部是纯开源的分布式异步协作运行模式。 社区就邀请了上海本地的小伙伴参与展位的解说和维护工作（社区为志愿者提供凹语言T恤、凹语言徽章和1000个贡献点，数量有限先报名先得）。</p><p><img src="'+n+'" alt=""></p><p><img src="'+_+'" alt=""></p><p>凹语言展位为参会的同学提供了免费的贴纸、三折页简介和金属徽章（其中徽章需要拍现场展台照片发朋友圈或技术群后免费领取），数量有限先到先得。</p>',15),m=[i];function h(d,g,f,w,k,u){return s(),a("div",null,m)}const A=t(c,[["render",h]]);export{C as __pageData,A as default};
